import React from "react"
import { Switch, Route, useHistory} from 'react-router-dom'
import AdmPage from "./Pages/AdmPage"
import LoginPage from "./Pages/Login";

export const useRoutesAdm = isAuthenticated => {
    if (isAuthenticated) {
        return (
    <Switch>
      <Route path="/admpage">
          <AdmPage/>
      </Route>
      </Switch>
            )
    }

    return (
        <Switch>
      <Route path="/login">
          <LoginPage/>
      </Route>
      
      </Switch>
        )
}
